window.onload=()=>{(async()=>{const e=await fetch("/getRoomData",{method:"GET",headers:{"Content-Type":"application/json"}}),n=await e.json();console.log(JSON.stringify(n));const o=n.rooms;if(console.log(JSON.stringify(o)),!n)return;const r=document.querySelector("#roomName"),a=document.querySelector("#roomTheme"),t=document.querySelector("#roomMembers"),i=o.length-1;switch(r.innerHTML=`Name: ${o[i].name}`,a.innerHTML="Theme: ",o[i].theme){case"default":a.innerHTML+="Default";break;case"coffee":a.innerHTML+="Coffee Shop";break;case"western":a.innerHTML+="Western";break;case"cyberpunk":a.innerHTML+="Cyberpunk";break;case"kawaii":a.innerHTML+="Kawaii";break;default:a.innerHTML+="Undefined"}t.innerHTML=`Amount of Members: ${o[i].amtMembers}`})()};